import React from "react";
import { Navigate } from "react-router-dom";
import Detail from "../views/detail";
import Entire from "../views/entire";
import Home from "../views/home";

export default [{ path: "/", element: <Navigate to="/home"/> },{
  path:'/home',
  element:<Home/>
},{
  path:'/detail',
  element:<Detail/>
},{
  path:'/entire',
  element:<Entire/>
}];
